(1, 1, 'LEVEL 1 (INSIGNIFICANT)', 'RIsiko minimal (Tidak ada Cidera), tidak terkait peraturan perundangan dan persyaratan K3L', 'Didalam Area Kerja', '< Rp. 500.000,-', '< 1 hari', 'Tidak menurunkan citra perusahaan', 1, 1, '2022-04-07', 1, '2022-04-08'),
(2, 2, 'LEVEL 2 (MINOR)', 'Risiko tidak mempengaruhi mutu, keselamatan kesehatan kerja (Cidera Kecil), lingkungan  namun menggangu, tidak melanggar peraturan perundangan & persyaratan K3L', 'Sampai Batas Dalam Konsesi Perusahaan', 'Rp. 500.000,-  sd Rp. 5.000.000,-', '1 sd 7 hari', 'Menurunkan citra perusahaan dalam kabupaten/ kotamadya', 1, 1, '2022-04-08', 1, '2022-04-08'),
(3, 3, 'LEVEL 3 (MODERATE)', 'Risiko mempengaruhi mutu, keselamatan kesehatan kerja (Cidera Sedang), lingkungan  jangka panjang, tidak konsisten pada peraturan perundangan & persyaratan K3L', 'Keluar Area Konsesi Perusahaan sampai 3 km (Sekitar perusahaan)', 'Rp.5.000.000,- sd Rp.50.000.000,-', '7 sd 30 hari', 'Menurunkan citra perusahaan dalam propinsi', 1, 1, '2022-04-08', 1, '2022-04-08'),
(4, 4, 'LEVEL 4 (MAJOR)', 'Risiko berakibat kritis pada mutu, keselamatan kesehatan kerja (Cidera Berat), lingkungan  serta tidak menerapkan peraturan perundangan & persyaratan K3L', 'Keluar Area Konsesi Perusahaan sampai 10 km', 'Rp.50.000.000,- sd Rp.100.000.000,-', '1 bulan sd 1 tahun', 'Menurunkan citra perusahaan nasional', 1, 1, '2022-04-08', 1, '2022-04-08'),
(5, 5, 'LEVEL 5 (CATASTROPIC)', 'Risiko menyebabkan kegagalan total, bencana atau kematian (Fatality) dan melanggar peraturan perundangan & persyaratan K3L', 'Keluar Area Konsesi Perusahaan lebih dari 10 km', '> Rp.200.000.000,-', '> 1 tahun', 'Menurunkan citra perusahaan internasional', 1, 1, '2022-04-08', 1, '2022-04-08');
