(1, '2022-11-30', '1', '17', 'Drain Residue Recovery ', 'RCA Team', 'Polymer process operator drained the liquid residual waste into the drum, the work started by prepared the drum and inserted the drain hose, then opened the valve to filled the drum./When filled the liquid residual waste into the drum, the operator has left it for another job./The drum used is a used TX88 drum which has a plastic hole at the bottom. When entered hot residual liquid waste the hole melted and opened than the residual liquid waste leaked to the drainage./TX88 used drums are not for place liquid residual waste.', 'Operator replaced the drum with DEG used drum/Operator was took the liquid residual waste in the drainage and monitored the drainage flow./Safety Team went to location and checked the all condition.', 'Residue  ', 'water', '½ Drum', 'Seet at the Fish Bone', 'Re-training residu drain job/Make WI for this job/Make roof and embankment in residu drain area.', 'Not knowing which standard drum to use  ', 'No Work Instruction for Drain Residue Liquid Waste Leakage in the drum Activity', 'The area is not equipped with proper bund wall causing the overflow can flowed to the drainage', 'The drum used is a used TX88 drum which has a plastic hole at the bottom. When entered hot residual liquid waste the hole melted and opened', 'No or Like Of Procedure,No or Like Of Awareness', 'Work Factor,Personal Factor', 'Unsafe Actions,Unsafe Conditions', 'Human,Machine,Environment', 'Make Work Instruction for Drain Residue Liquid Waste Leakage in the drum Activity', 'Saptaii', 'Satu bulan', 'Picture1.jpg,Picture2.jpg,Pic776339.jpg,Pic748975.jpg,Pic378994.jpeg', 'Saptai', NULL, 1, '2022-11-30', '07:03:32', 1, '2022-11-30', '07:03:32');
