(13, '1', '2022-08-23', '08:55:00', 'POG FIB', '1', 'I-227', 46, 'Mr. ACHMAD SAPUTRA', '2', 52, 'Operator', '27', 'At 13.30 Mr. Reza Maulana and his partners prepared a cans box that contained tow on return line then they inserted that cans box to the traversing line 31.\n13.35 Mr. Reza and his two partners pushed the cans box manually because the QTV machine was broke\n13.40 When Mr. Reza pushed the cans box, his forefinger was caught between the cans box and he spontaneously pulled his hand and he got a torn wound on his forefinger', '22', 'A torn wound on the forefinger of his right hand, got 17 stitches', 'MINOR', 'MEDIUM', 'POSSIBLE', 'headed to the pratama clinic PT. Asia Pacific Fibers, the wound was cleaned and taken to the hospital', '2022-08-26', 'No refresh training about the job,Lack of coordination when pushing the cans box', 'Didn’t use proper tools to push the cans box ', 'Almost all of the rollers on the traversing  line was broke,The QVT machine was broke', 'The cans box is too heavy', 'No or Like Of Procedure,No or Like Of Tools,No or Like Of Awareness', 'Personal Factor', 'Unsafe Actions,Unsafe Conditions', 'Human,Machine,Material,Environment', 'Provide refresh training about the job', 'Mr. Haryanto / Mr. Asep Hendra', 'November, 2022', 'default.jpg', 'LEAD NAME', 'MEMBER NAME 1', 1, '2022-08-23', '04:01:12', 1, '2022-08-23', '04:01:12'),
