(15, '1', '2024-10-11', '16:58:00', 'Green Land', '1', 'V-2099', 190, 'Mr. ESRON ALEX TAMPUBOLON', '3', 55, 'Manager', '28', 'Mr. Andika is a fiber process operator. /When the HSE Academy in Fire Drill session the fire extinguishing activity in the drum using a fire blanket, Mr. Andika got the 4th turn to cover the fire drum using a fire blanket with a large fire condition (that was experienced by all participants)/Mr. Andika when covering the fire drum using a fire blanket too quickly and panicked then stepped back a little so that the fire drum was not completely covered, then Mr. Andika lifted the fire blanket too high so that the fire blanket exceeded the surface of the drum and suddenly the fire that was not completely covered by the fire blanket then the fire hit the right side of his face/Then Mr. Andika\'s burns were given running water for 15 minutes and treated by doctors and paramedics', '2,3,4', 'Nothing', '2', '2', '1', 'Immediately doused the face with running water ±15 minutes/After that, Mr. Andika given treatment immediately in PT. Asia Pacific Fiber Pratama Clinic by doctor and paramedic/Treatment by doctors and paramedics with administration of burnazin and bioplacenton ointment for skin burns type 1 - 2 and burn area 6 - 9%', '2024-10-11', 'Too fast, and was panic so fire blanket raise above the height of drum ', 'Not using PPE (face shield, fire resistant gloves) ', 'ADAD, KAHSDK', 'The standard size of the fire blanket is too short', 'No or Like Of Procedure,No or Like Of Tools,No or Like Of Awareness,No or Like Of Obedience', 'Personal Factor', 'Unsafe Actions,Unsafe Conditions', 'Human', 'Fire Blanket replaced  with a longer one/Provide a Face shield and a gloves /Drum cut to a shorter length/the addition of a safety shower', 'TOMY ARIYANTO,TOMY ARIYANTO,TOMY ARIYANTO,TOMY ARIYANTO', '2024-10-11,2024-10-11,2024-10-11,2024-10-11', 'compressed_incident_image_0.JPG,compressed_incident_image_1.JPG,compressed_incident_image_2.JPG', 'LEAD INV', 'MEMBER  1', 1, '2024-10-11', '17:09:14', 1, '2024-10-11', '17:09:14');
